import React from "react";
import "../styles/styleLogin.css";
import "../styles/bootstrap.min.css";
// import logo from "../images/logoM.png";
import { withRouter } from "react-router-dom";
import { connect } from "unistore/react";
import { actions } from "../store";

class LoginPayer extends React.Component {
  render() {
    return (
      <React.Fragment>
        <form onSubmit={"#"}>
          <div
            className="col-sm-12"
            style={{ display: "grid", textAlign: "left", marginLeft: "20px" }}
          >
            <span style={{ marginLeft: "5px" }}>NPWP :</span>
            <input
              type="text"
              id="NPWP"
              className="col-md-12 col-sm-12 fadeIn second"
              name="NPWP"
              placeholder="Input NPWP"
              //   onChange={}
            />
          </div>
          <div
            className="col-sm-12"
            style={{ display: "grid", textAlign: "left", marginLeft: "20px" }}
          >
            <span style={{ marginLeft: "5px" }}>PIN :</span>
            <input
              type="password"
              id="PIN"
              className="col-md-12 col-sm-12 fadeIn second"
              name="PIN"
              placeholder="Input PIN"
              //   onChange={}
            />
          </div>
          <input
            type="submit"
            className="fadeIn fourth"
            value="Log In"
            style={{ marginBottom: "15px", marginTop: "10px" }}
            //   onClick={this.handleLogin}
          />
        </form>
      </React.Fragment>
    );
  }
}

export default connect("", actions)(withRouter(LoginPayer));
